package JavaBasics_Part1;

public class SwapTwoVariables {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 10;
		int b = 20;
		int temp;
		
		temp = a; // temp = 10
		a = b;    // a = 20
		b = temp;    // b = 10
		
		System.out.println(a);
		System.out.println(b);

	}

}
